INSERT INTO `wemall_template` VALUES (229384, '2013-09-03 10:32:50', b'0', '$!user.userName,您好，您的店铺因违规被关闭！原因是:$!reason<br />', '[给卖家]店铺被管理员关闭时的通知', 'msg_toseller_store_closed_notify', b'1', '店铺违规关闭', 'msg');
